import './App.css';
import Admin from './Admin';
import User from './User';
import {Route, Link, Router} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router exact path="/admin" component = {Admin}/>
      <Router exact path="/user" component = {User}/>
    </div>
  );
}

export default App;
